import React from 'react'
import App from '../App'
import './ExpensesItems.css'

export const ExpensesItem = (props) => {
  return (
    <div className='ExpensesItems'>
        <h2>{props.title}</h2>

        <h2>{props.amount}</h2>
        <h2>{props.pris}</h2>
    </div>
  )
}
